import React, { Component } from 'react'

export default class LoFi extends Component {
    render() {
        return (
            <div className="wrapper">
                <iframe className="player" width="20%" height="450" scrolling="no" frameborder="no" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/playlists/601710774&color=%239c5cba&auto_play=true&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>

                <img src='https://66.media.tumblr.com/35cd8d3a5a350997ef3f7a71350efa9e/1ed772b41ffa92e6-2b/s500x750/48bae543cc99d3b468d7b52ec73687c7a4c32df4.gifv' id='selector'/>
            </div>
        )
    }
}
